import logo from './zyinno.png';


//定义一个React组件
class App extends Component {
  render() {  //React组件中必须有一个render函数
    return (
      <div>
        <div>
        <img src={logo} className="App-logo" alt="logo" />
        智宇创新
        </div>
        <div>智宇创新2</div>
        <div>智宇创新3</div>
      </div>
    );
  }
}

export default App; //组件定义好之后，导出了在别的地方才能引用
